85%D1%82\" title=\"\u0412\u0435\u0440\u043c\u0430\u0445\u0442\">\u043d\u0435\u043c\u0435\u0446\u043a\u0438\u0445<\/a> \u0438 \u0432\u0435\u043d\u0433\u0435\u0440\u0441\u043a\u0438\u0445 \u0432\u043e\u0439\u0441\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1962_%D0%B3%D0%BE%D0%B4\" title=\"1962 \u0433\u043e\u0434\">1962<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%B8%D0%B1%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D1%80%D0%B8%D0%B7%D0%B8%D1%81\" title=\"\u041a\u0430\u0440\u0438\u0431\u0441\u043a\u0438\u0439 \u043a\u0440\u0438\u0437\u0438\u0441\">\u041a\u0430\u0440\u0438\u0431\u0441\u043a\u0438\u0439 \u043a\u0440\u0438\u0437\u0438\u0441<\/a>: \u0440\u0430\u0437\u0432\u0435\u0434\u044b\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0439 \u0441\u0430\u043c\u043e\u043b\u0451\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Lockheed_U-2\" title=\"Lockheed U-2\">U-2<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%92%D0%A1_%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0412\u0412\u0421 \u0421\u0428\u0410\">\u0412\u0412\u0421 \u0421\u0428\u0410<\/a> \u0441\u0431\u0438\u0442 \u043d\u0430\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D0%B1%D0%B0\" title=\"\u041a\u0443\u0431\u0430\">\u041a\u0443\u0431\u043e\u0439<\/a> \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1-75\" title=\"\u0421-75\">\u0437\u0435\u043d\u0438\u0442\u043d\u043e\u0439 \u0440\u0430\u043a\u0435\u0442\u043e\u0439<\/a>; \u043f\u0438\u043b\u043e\u0442 \u043c\u0430\u0439\u043e\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D0%B4%D0%BE%D0%BB%D1%8C%D1%84_%D0%90%D0%BD%D0%B4%D0%B5%D1%80%D1%81%D0%BE%D0%BD\" class=\"mw-redirect\" title=\"\u0420\u0443\u0434\u043e\u043b\u044c\u0444 \u0410\u043d\u0434\u0435\u0440\u0441\u043e\u043d\">\u0420\u0443\u0434\u043e\u043b\u044c\u0444 \u0410\u043d\u0434\u0435\u0440\u0441\u043e\u043d<\/a> \u043f\u043e\u0433\u0438\u0431. \u041f\u0440\